using Marketplace.DAL.Models;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using System.Web;

namespace Marketplace.DAL.Repositories
{
    public class ProductRepository : IProductRepository
    {
        private Random rnd;
        private List<Product> listOfProducts;
        private readonly HttpContextBase _httpContext;

        public ProductRepository(HttpContextBase httpContext)
        {
            rnd = new Random();
            _httpContext = httpContext;
            InitData();
        }

        public IEnumerable<Product> GetProducts()
        {
            var products = listOfProducts;
            return products;
        }

        public Product GetProduct(Guid id)
        {
            var product = listOfProducts.FirstOrDefault(x => x.Id == id);
            return product;
        }

        public bool AddProduct(Product product)
        {
            listOfProducts.Add(product);
            return true;
        }

        public bool RemoveProduct(Guid id)
        {
            var product = listOfProducts.FirstOrDefault(x => x.Id == id);
            listOfProducts.Remove(product);
            return true;
        }

        public bool UpdateProduct(Product product)
        {
            var count = listOfProducts.FindIndex(x => x.Id == product.Id);
            listOfProducts[count] = product;
            return true;
        }

        private void InitData()
        {
            listOfProducts = _httpContext.Session["Products"] as List<Product>;
            if (listOfProducts == null) 
            {
                _httpContext.Session["Products"] = new List<Product>();
                listOfProducts = _httpContext.Session["Products"] as List<Product>;
                for (int i = 0; i < 100; i++)
                {
                    listOfProducts.Add(new Product()
                    {
                        Id = Guid.NewGuid(),
                        Name = "Зов пустоты",
                        Author = "Максим Шаттам",
                        CategoryId = 3,
                        Price = rnd.Next(10,1000),
                        Description = "Не успев оправиться от прошлого дела, лейтенант Парижского отдела жандармерии Лудивина Ванкер с головой окунается в новое расследование. На железнодорожных путях найден труп мужчины без ног и верхней части головы. Все попытки обнаружить ДНК убийцы на теле жертвы оборачиваются провалом – кто-то тщательно вымыл несчастного в хлорке, прежде чем положить его на рельсы. Расследование становится еще более запутанным, когда выясняется, что убитый несколько лет назад обратился в радикальный ислам.\r\n\r\nСтранные убийства продолжаются. Некоторые из них несут на себе почерк кровожадного маньяка, другие похожи на религиозный ритуал. Кажется, у зла появилось новое обличье.",
                        Quantity = 3,
                        Photo = ""
                    });
                }
            }
        }
    }
}
